            enumerations = ['AAJ', 'ABW', 'AFE', 'ALX', 'BRD', 'DGC', 'ECN', 'INB', 'MAK', 'PAN', 'PON', 'SE', 'SON', 'OID', 'DTC', 'DTM', 'DTQ', 'DTR', 'ITR', 'MID', 'OED', 'OET', 'OOR', 'SME', 'USM', 'AAM', 'CFR', 'DOM', 'FOR', 'USG', 'MAT']
